/*
 * alive  1        ,
 * alive  0       .
 */
int alive = 1;

/*
 * Reader    N .   <AAA...AA>  .
 *     0 A, 1 B, ...,  ,   <...> .
 *  reader <AAA...AA>   , critical section reader
 *    reader       .
 */

int read_count = 0;  //    reader 
int write_count = 0; //    writer 

pthread_mutex_t r_mutex; // reader reader_count   mutex
pthread_mutex_t w_mutex; // writer writer_count   mutex
pthread_mutex_t r_block; // writer  reader lock mutex
pthread_mutex_t w_block; //   writer CS     mutex

void *reader(void *arg)
{
        int id, i;


        /*
        *       .
        */
        id = *(int *)arg;
        /*
        *        <XXX...XX>  .
        */
        while (alive) {
                pthread_mutex_lock(&r_block);
		pthread_mutex_lock(&r_mutex);
		read_count++;
		if (read_count == 1)
			pthread_mutex_lock(&w_block);
		pthread_mutex_unlock(&r_mutex);
		pthread_mutex_unlock(&r_block);
		/*
                * Begin Critical Section
                */
                printf("<");
                for (i = 0; i < N; ++i)
                        printf("%c", 'A'+id);
                printf(">");
                /* 
                * End Critical Section
                */
		pthread_mutex_lock(&r_mutex);
		read_count--;
		if (read_count == 0)
			pthread_mutex_unlock(&w_block);
		pthread_mutex_unlock(&r_mutex);
        }
        pthread_exit(0);
}

/*
 * Writer      .
 *        .
 * Writer critical section   writer   reader   .
 *     writer reader      .
 */
void *writer(void *arg)
{
        int id, i;
        struct timespec req, rem;

        /*
        *       .
        */
        id = *(int *)arg;
        /*
        *            1  .
        */
        req.tv_sec = 0;
        req.tv_nsec = 1L;
        /*
        *        .
        */
        while (alive) {
                pthread_mutex_lock(&w_mutex);
                write_count++;
                if (write_count == 1)
			pthread_mutex_lock(&r_block);
                pthread_mutex_unlock(&w_mutex);
		pthread_mutex_lock(&w_block);
                /*
                * Begin Critical Section
                */
                printf("\n");
                switch (id) {
                        case 0:
                                for (i = 0; i < L1; ++i) {
                                        printf("%s\n", t[i]);
                                        nanosleep(&req, &rem);
                                } 
                                break;
                        case 1:
                                for (i = 0; i < L2; ++i) {
                                        printf("%s\n", d[i]);
                                        nanosleep(&req, &rem);
                                }
                                break;
                        case 2:
                                for (i = 0; i < L3; ++i) {
                                        printf("%s\n", e[i]);
                                        nanosleep(&req, &rem);
                                }
                                break;
                        default:
                        ;
                }
                /* 
                * End Critical Section
                */
                pthread_mutex_unlock(&w_block);
                pthread_mutex_lock(&w_mutex);
		write_count--;
                if (write_count == 0)
			pthread_mutex_unlock(&r_block);
		pthread_mutex_unlock(&w_mutex);
        }
        pthread_exit(0);
}

/*
 *   RNUM  reader  , WNUM  writer  .
 *      0.2   alive  0   
 *       ,       .
 */
int main(void)
{
        int i;
        int rarg[RNUM], warg[WNUM];
        pthread_t rthid[RNUM];
        pthread_t wthid[WNUM];
        struct timespec req, rem;
	
	// mutex lock 
	pthread_mutex_init(&r_mutex, NULL);
	pthread_mutex_init(&w_mutex, NULL);
	pthread_mutex_init(&r_block, NULL);
	pthread_mutex_init(&w_block, NULL);

        /*
        * Create RNUM reader threads
        */
        for (i = 0; i < RNUM; ++i) {
                rarg[i] = i;
                if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
                	fprintf(stderr, "pthread_create error\n");
                	exit(-1);
                }
        }
        /* 
        * Create WNUM writer threads
        */
        for (i = 0; i < WNUM; ++i) {
                warg[i] = i;
                if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
                        fprintf(stderr, "pthread_create error\n");
                        exit(-1);
                }
        }
        /* 
        * Wait for 1.1 second while the threads are working
        */
        req.tv_sec = 1;
        req.tv_nsec = 100000000L;
        nanosleep(&req, &rem);
        /*
        * Now terminate all threads and leave
        */
        alive = 0;
        for (i = 0; i < RNUM; ++i)
                pthread_join(rthid[i], NULL);
        for (i = 0; i < WNUM; ++i)
                pthread_join(wthid[i], NULL);
        exit(0);
}

